import { __decorate } from "tslib";
import { Component } from '@angular/core';
let UploadTabelasComponent = class UploadTabelasComponent {
    constructor(api) {
        this.api = api;
    }
    onFilechange(event) {
        console.log(event.target.files[0]);
        this.arquivos = event.target.files[0];
    }
    ngOnInit() { }
    async enviarArquivo() {
        const resposta = await this.api.importarCBF(this.arquivos);
    }
    handleChange({ file, fileList }) {
        const status = file.status;
        if (status !== 'uploading') {
            console.log(file, fileList);
        }
        if (status === 'done') {
            this.msg.success(`${file.name} file uploaded successfully.`);
        }
        else if (status === 'error') {
            this.msg.error(`${file.name} file upload failed.`);
        }
    }
};
UploadTabelasComponent = __decorate([
    Component({
        selector: 'app-administracao',
        templateUrl: './uploadTabelas.component.html',
        styleUrls: ['./uploadTabelas.component.scss'],
    })
], UploadTabelasComponent);
export { UploadTabelasComponent };
